            if (baseline > 0)
                fontY = baseline - font.GetFontDescriptor(BaseFont.DESCENT, size);
            else
                fontY = -baseline + size;
            fontX = font.GetWidthPoint(altText != null ? altText : code, size);
        }
        return new Rectangle(x, y, fontX, fontY);
    }
