def create_certs(module, name, apiid, apikey):
    meters = search_meter(module, name, apiid, apikey)
    if len(meters) > 0:
        # If the meter already exists, do nothing
        module.exit_json(status="Meter " + name + " already exists",changed=False)
    else:
        # If it doesn't exist, create it
        body = '{"name":"' + name + '"}'
        response, info = http_request(module, name, apiid, apikey, data=body, action="create")
        if info['status'] != 200:
            module.fail_json("Failed to connect to api host to create meter")
        # If the config directory doesn't exist, create it
        if not os.path.exists(config_directory):
            try:
                os.makedirs(config_directory)
            except:
                module.fail_json("Could not create " + config_directory)
        # Download both cert files from the api host
        types = ['key', 'cert']
        for cert_type in types:
            try:
                # If we can't open the file it's not there, so we should download it
                cert_file = open('%s/%s.pem' % (config_directory,cert_type))
            except IOError:
                # Now download the file...
                rc = download_request(module, name, apiid, apikey, cert_type)
                if rc == False:
                    module.fail_json("Download request for " + cert_type + ".pem failed")
        return 0, "Meter " + name + " created"
def download_request(module, name, apiid, apikey, cert_type):
    url = "https://%s/%s/meters/%s/%s.pem" % (api_host, apiid, name, cert_type)
    headers = dict()
    headers["Authorization"] = "Basic %s" % auth_encode(apikey)
    headers["Content-Type"] = "application/json"
    response, info = fetch_url(module, url, headers=headers)
    if info['status'] != 200:
        module.fail_json("Failed to connect to api host to download cert")
    return 0
def main():
    module = AnsibleModule(
        argument_spec=dict(
            name=dict(required=True),
            apiid=dict(required=True),
            apikey=dict(required=True),
            state=dict(required=False, default='present', choices=['present', 'absent']),
            validate_certs=dict(required=False, default='yes', choices=['yes', 'no']),
        ),
        supports_check_mode=True
    )
    name = module.params['name']
    apiid = module.params['apiid']
    apikey = module.params['apikey']
    state = module.params['state']
    validate_certs = module.params['validate_certs']
    if state == 'absent':
        if not search_meter(module, name, apiid, apikey):
            module.exit_json(changed=False, status="Meter " + name + " does not exist")
    else:
        if search_meter(module, name, apiid, apikey):
            module.exit_json(changed=False, status="Meter " + name + " already exists")
    if state == 'present':
        if create_meter(module, name, apiid, apikey):
            module.exit_json(changed=True, status="Meter " + name + " created")
        else:
            module.exit_json(changed=False, status="Meter " + name + " already exists")
    elif state == 'absent':
        if delete_meter(module, name, apiid, apikey):
            module.exit_json(changed=True, status="Meter " + name + " deleted")
        else:
            module.exit_json(changed=False, status="Meter " + name + " does not exist")
    elif state == 'present':
        if create_certs(module, name, apiid, apikey):
            module.exit_json(changed=True, status="Meter " + name + " created")
        else:
            module.exit_json(changed=False, status="Meter " + name + " already exists")
    else:
        module.fail_json("Invalid state")

