private void getCategoriesforType(ODRClient odrClient) {
	categories = new ArrayList<Category>();
	List<Category> availableCategories = odrClient.listCategories();
	if (availableCategories.size() > 0) {
		LOG.debug("Number of available categories: "
				+ availableCategories.size());
		try {
			if (odrMetadata.getType().equals(MetadataEnumType.DATASET)
					|| odrMetadata.getType().equals(
								MetadataEnumType.UNKNOWN)) {
				for (Category category : availableCategories) {
					if (category.getType().equals(CategoryEnumType.DATA)) {
						categories.add(category);
					}
				}
			} else if (odrMetadata.getType().equals(
					MetadataEnumType.APPLICATION)) {
				for (Category category : availableCategories) {
					if (category.getType().equals(CategoryEnumType.DATA)) {
					categories.add(category);
					}
				}
			} else if (odrMetadata.getType().equals(
					MetadataEnumType.DOCUMENT)) {
				for (Category category : availableCategories) {
					if (category.getType().equals(CategoryEnumType.DATA)) {
						categories.add(category);
					}
				}
			}
		} catch (Exception e) {
		LOG.error("Error while getting categories: " + e.getMessage());
		}
	}
